  const handleCreateSession = () => {
    connectWebSocket();
    // console.log(sessionId)
    createSession();
  };

  return (
    <div>
      <h2>Create a New Session</h2>
      <button onClick={handleCreateSession}>Create Session</button>
    </div>
  );
};

export default CreateSessionPage;
